import React from "react";
import "../scss/header.scss";

import Logo from "../assets/icon-header.png";

const Footer = () => {
  return (
    <nav className="header-container">
      <div className="header-logo">
        <img className="header-logo" src={ Logo } alt="" />
      </div>
    </nav>
  );
}

export default Footer;
